sys_variable_value.value:
(function execute(inputs, outputs) {
    try{
        var cEnc = new CertificateEncryption();
        var key = gs.base64Encode(inputs.key);
        outputs.mac = cEnc.generateMac(key, inputs.algorithm, inputs.data);
    } catch(ex){
        outputs.error = ex + "";
    }
})(inputs, outputs);

